import React from "react";
import "./Artist.css";
const Artists = () => {
  return (
    <div className="artists-page">
      <h1 className="welcome">Welcome to spotify (Artists page)</h1>
      <a id="artist-button" href="/amr-diab">
        Amr Diab Page
      </a>
    </div>
  );
};
export default Artists;
